import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { ContentRoute } from "../../../../_metronic/layout";
import { PaymentCollectionPage } from "./PaymentCollectionPage"
import { CollectionData } from "./tabs/CollectionData"
import { CollectionDataView } from "./view-pages/CollectionDataView"
export function PaymentCollectionRouting() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/salescollection/payment-collection"
        to="/salescollection/payment-collection/list"
      />

      <ContentRoute
        path="/salescollection/payment-collection/list"
        component={PaymentCollectionPage}
      />
       <ContentRoute
        path="/salescollection/payment-collection/collection-data"
        component={CollectionData}
      />
      <ContentRoute
        path="/salescollection/payment-collection/collection-data-view"
        component={CollectionDataView}
      />
    </Switch>
  );
}
